  //   } catch (error) {
  //     console.warn(e);
  //   }

  //   return () => SplashScreen.hideAsync();
  // }, [])

  useEffect(() => {
    SplashScreen.preventAutoHideAsync();
    setTimeout(() => {
      SplashScreen.hideAsync();
    }, 300);
  }, [])

  return (
    <SafeAreaProvider>
      <Navigation />
      <StatusBar style="none"/>
    </SafeAreaProvider>
  );
}
